import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from 'react-router-dom';
import logo from './logo.svg';
import './App.css';
import Message from './components/Message';



function App() {
  const data = [
    {id: 1, name: 'Vasya', logo, title: 'Title', text: 'Hello World'},
    {id: 2, name: 'Oleg', logo, title: 'Lol Oleg', text: 'Hello Peace'},
    {id: 3, name: 'Maria', logo, title: 'Maria Lol', text: 'Hello'}
  ]

  return (
    <Router>
      <nav className="navigation">
        <ul className="navigation-list">
          <li>
            <Link to="/" className="navigation-link">
            Home
            </Link>
          </li>
          <li>
            <Link to="/hello" className="navigation-link">
            Hello
            </Link>
          </li>
          <li>
            <Link to="/signin" className="navigation-link">
            Reg
            </Link>
          </li>
        </ul>
      </nav>
      <Switch>
        <Route path="/" exact>
        <div className="App">
      {data.map(({ name, logo, title, text, id }) => {
        return (
          <Message 
        name={name}
        logo={logo}
        title={title}
        text={text}
        key={id}
        /> 
        ) 
      })}
    </div>
        </Route>
        <Route path="/hello">
          Hello!
        </Route>
        <Route path="/signin">
          Registattion!
        </Route>
      </Switch>
    </Router>

  );
}

export default App;
